import React from 'react';
import Stepper from '@material-ui/core/Stepper';
import Step from '@material-ui/core/Step';
import StepLabel from '@material-ui/core/StepLabel';
import { CheckIcon, InProgressIcon } from '../../asset/icons/box/index.js';
import './progress.css'; 

const steps = ['Confirmed', 'In Progress', 'Ready'];

const icons = {
  completed: <CheckIcon className='text-white' />,
  incomplete: <InProgressIcon className='text-white' />,
};

const Progress = ({ currentStep }) => (
  <Stepper activeStep={currentStep} alternativeLabel className="bg-primary">
    {steps.map((label, index) => (
      <Step key={label} completed={currentStep > index}>
        <StepLabel
          StepIconComponent={(props) =>
            icons[props.completed ? 'completed' : 'incomplete']
          }
        >
          {label}
        </StepLabel>
      </Step>
    ))}
  </Stepper>
);

export default Progress;
